"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[7970],{72736:e=>{e.exports=JSON.parse('{"Where should it go? Tap the map to place this building.":"Gdzie powinno to zostać zbudowane? Stuknij wybrane miejsce aby postawić budynek.","Cancel Build":"Anuluj Budowę","Move Map":"Zmiana Mapy","Continue":"Kontynuuj","Level":"Poziom","Discord":"Discord","Patreon":"Patreon","Get help":"Potrzebujesz pomocy?","Options":"Opcje","Appearance":"Wygląd","Runeshop":"Sklep Runiczny","Follower":"Towarzysz","Change Class":"Zmień Klasę","Inventory":"Inwentarz","Spells":"Czary","Skills":"Umiejętności","Status":"Status","Equipment":"Ekwipunek","Party":"Drużyna","You do not have any party members. Invite your allies to a party to share experience and fight battles together.":"Nie masz żadnych członków w drużynie. Zaproś swoich sojuszników do drużyny, aby dzielić się doświadczeniem i wspólnie toczyć bitwy.","Disband party":"Rozwiąż drużynę","Leave party":"Opuść drużynę","Are you sure you would like to leave this party?":"Czy na pewno chcesz opuścić tę drużynę?","No":"Nie","Yes":"Tak","Current bonus:":"Obecny bonus:","Time left:":"Pozostały czas:","Character":"Postać","Codex":"Encyklopedia","You have left the party":"Opuszczono drużynę","Town Development":"Rozbudowa Miasta","Buildings":"Budynki","Decorations":"Ozdoby","Costs:":"Koszt:","Build":"Buduj","Am I building something today?":"Czy mam coś dzisiaj zbudować?","Aye, traveler.":"Aye, podróżniku.","Pleasure to meet ye.":"Miło mi Cię widzieć.","The name\'s Gofannon. Samson says you\'ll need my help building out your Origin Town.":"Nazywam się Gofannon. Samson mnie poinformował że będziesz potrzebować mojej pomocy przy budowie Twojego Miasta Rodzinnego.","An Unfelled\'s home is of dire importance. Here, we can build buildings of many a use.":"Dom członka Zakonu Niepokonanych jest ważną sprawą. Zbudujemy tutaj wiele rzeczy, które będą miały szereg zastosowań.","I\'ll help ye. I\'ll even build ye your first Shop for free. But ye free ride ends there, I\'m afraid.":"Pomogę Ci. Zbuduję nawet dla Ciebie pierwszy Sklep. Ale darmowe rzeczy się tutaj kończą.","Shall we get started, then?":"Zaczynamy?","Gofannon":"Gofannon","My name is Samson. And what is yours, traveler?":"Nazywam się Samson. Jak się zwiesz, podróżniku?","New character name":"Nowe imię postaci","Connect Google Play Games":"Połącz z Google Play Games","Sandbox mode":"Tryb Sandbox","Start at level 250 with a large inventory":"Rozpocznij grę z poziomem 250 i ekwipunkiem pełnym dobroci","By continuing, you verify that you are at least 13 years of age and agree to the:":"Potwierdzasz, że masz ukończony 13 rok życia i zgadzasz się z:","privacy policy":"polityką prywatności","terms of service":"warunkami korzystania z usługi","If you would like to attach an email address to your character, you can enter it below. We will only use your email address for character recovery options.":"Jeżeli chcesz dodać adres e-mail do swojego konta, wprowadź je poniżej. Będzie on używany tylko w celach odzyskania konta.","Email address (optional)":"Adres email (niewymagane)","Promo code (optional)":"Kod promocyjny (opcjonalnie)","When encountering a foe in combat, which of the following are you?":"Kiedy spotykasz wroga w bitwie, kim jesteś?","The Warrior":"Wojownik","High HP and Attack power, low usage of skills.":"Wysokie PZ i siła Ataku, rzadko używa umiejętności.","The Mage":"Mag","Low HP and Attack power, but higher magical power. High usage of spells.":"Niskie PZ oraz siła Ataku, lecz wysoce obeznany w sztuce magicznej. Uzywa czarów.","The Thief":"Złodziej","Moderate HP, high Attack power, moderate magical power. Higher usage of status effects.":"Umiarkowane PZ, siła ataku oraz umiejętności magiczne. Nakłada efekty statusu na wrogów.","Meet me in Loton, traveler.":"Spotkajmy się w Loton, podróżniku.","Cancel":"Anuluj","Achievements & Record":"Osiągnięcia i Dziennik","Play":"Graj","Explore the world and fight monsters.":"Eksploruj świat i walcz przeciwno różnym przeciwnikom.","Kingdom":"Królestwo","Kingdoms":"Królestwa","View or join a Kingdom.":"Zobacz lub dołącz do Królestwa.","Purchase items or character appearance options from the Runeshop.":"Kup przedmioty lub stroje postaci poprzez Sklep Runiczny.","Unfelled Recruitment":"Rekrutacja Niepokonanych","Earn rewards by inviting your friends to the game.":"Zdobywaj nagrody zapraszając graczy do gry.","Change your character\'s class, access your inventory, and more.":"Zmień klasę Twojej postaci, otwórz ekwipunek i wiele więcej.","Quests":"Zadania","Change game settings and options.":"Zmień opcje gry.","Title Menu":"Menu Główne","Return to the title screen.":"Wróć do menu głównego.","Event":"Wydarzenie","Athantia":"Athantia","Athantia is coastal home to the Athantians.":"Athantia jest przybrzeżną ojczyzną Athantian.","Market":"Targ","Creatures of the Deep":"Stworzenia z Głębin","Athantia Temple":"Świątynia Athantii","Avalon":"Avalon","The Kingdom of Avalon is possibly the most well known of Kingdoms, though much of its influence is long lost.":"Królestwo Avalonu jest prawdopodobnie najbardziej znanym królestwem, chociaż wiele jego wpływów zostało dawno utraconych.","Avalon Market":"Avaloński Targ","Odds & Ends":"Szanse i Zagrożenia","Smith of Avalon":"Avalońska Kuźnia","Lady by the Lake":"Pani Jeziora","Merlin\'s Apprentices":"Uczniowie Merlina","Avalon Herbalist":"Zielarz Avalonu","Balor":"Balor","The dark and volcanic land of the forces of Balor.":"Ciemny i wulkaniczny teren sił Balora.","Odin\'s Forge":"Kuźnia Odyna","Balor Spells":"Zaklęcia Balora","Balor Beasts":"Bestie Balora","Prometheus\'s Workbench":"Stół Warsztatowy Prometeusza","Demeter\'s Rest":"Odpoczynek u Demeter","A quiet village at the foot of the gods.":"Spokojnia wioska u podnóża bogów.","Demeter\'s Rest Inn":"Karczma Odpoczynek U Demeter","Demeter\'s Rest Hall":"Hala Odpoczynek U Demeter","Fishing Hut":"Chata Rybacka","The humble home of a great angler.":"Skromny dom wielkiego rybaka.","Forest Clearing":"Leśna Polana","A small clearing in Loton Woods.":"Mała polana w Lesie Loton.","Origin Town":"Miasto Rodzinne","Where it all began.":"Gdzie wszystko się zaczęło.","Your Home":"Twój Dom","Jotunheim":"Jotunheim","Jotunheim was once land to the giants. It is now a home to those they left behind.":"Jotunheim był kiedyś krainą gigantów. Jest teraz domem dla tych, którzy zostali pozostawieni.","Songs of the Giants":"Pieśni Olbrzymów","Larger Than Life":"Większe Niż Życie","Mountain Bestiary":"Górzysty Bestiariusz","Mountain\'s Rest":"Odpoczynek w Górach","Loton":"Loton","Loton is a humble and simple village.":"Loton jest skromną i prostą wioską.","General Store":"Sklep z Różnorościami","Loton Town Hall":"Lotoński Ratusz","New Lyonesse":"Nowe Lyonesse","Snowy land of Lyonesse, a Kingdom of divinity and grace.":"Śnieżna kraina Lyonesse, królestwo boskości i łaski.","Northern Trader":"Handlarz z Nothren","Bright Smith":"Kowal Światła","Sacred Jewels":"Klejnoty Boskości","Divine Beasts":"Boskie Stworzenia","Lyonesse Grounds":"Teren Lyonesse","Lythryn":"Lythryn","Home of the elves. Humans may not find it welcoming.":"Elfie miasto, w którym ludzie nie są mile widziani.","Elven Alchemist":"Elfi Alchemik","Jeweller of the Woods":"Jubiler Lasu","Myrkheim":"Myrkheim","Myrkheim is the underground home of the dwarven people.":"Myrkheim jest podziemnym domem karłów.","Myrkheim Trader":"Handlarz z Myrkheim","Myrkheim Bazaar":"Targ Myrkheim","Nothren Settlement":"Osada Nothren","Nothren, muddy land of those who run with beasts.":"Nothren, błotnista kraina bliskich z bestiami.","Trader":"Handlarz","Brokkr\'s Forge":"Kuźnia Brokkra","Freyja\'s Followers":"Towarzysze Freyji","The South Rest":"Południowa Drzemka","Nothren Town Hall":"Ratusz Nothren","Onogoro":"Onogoro","Secret island of Onogoro. ":"Ukryta wyspa Onogoro. ","Field Bestiary":"Bestiariusz Terenowy","Resting Place":"Miejsce Na Odpoczynek","A forest clearing, tribute to one that is lost.":"Leśna polana, hołd dla zaginionego.","Suddun":"Suddun","A land of traders and appreciators of the finer things, Suddun lies to the East.":"Suddun, kraina kupców i wielbicieli rzadkich przedmiotów, która znajduje się na wschodzie.","Suddun Market":"Sklep Suddun","Suddun Bazaar":"Targ Suddun","The Sands":"Piaski","Suddun Bestiary":"Bestiariusz Suddun","The Oasis Jewels":"Klejnoty Oazy","Svarga":"Svarga","A quiet fishing town, Svarga lists along the great Svarga river.":"Ciche miasteczko dedykowane rybactwu, Svarga rozciąga się wzdłuż wielkiej rzeki.","Svarga Smith":"Svargański Kowal","Svarga Bestiary":"Svargański Bestiariusz","Titan Workshop":"Kuźnia Tytanów","One of the few remaining structures abandoned by the Olympians.":"Jedna z niewielu pozostałych budowli opuszczonych przez Olympian.","Vinland":"Vinland","To the North lies Vinland, a town of wealth.":"Na północy leży Vinland, miasto bogactwa.","Vinland Beasts":"Bestie Vinlandu","Rose\'s Rest":"Odpoczynek u Rose","Origin":"Oryginału","Loton Woods":"Las Loton","Great Plains":"Wielkie Równiny","The Outskirts":"Przedmieścia","Lythryn Woods":"Las Lythryn","Great Athantia":"Wielka Athantia","Suddun Dunes":"Wydmy Suddun","Suddun Desert":"Pustynia Suddun","Kingdom of Avalon":"Królestwo Avalonu","The Great Bridge":"Wielki Most","Valhalla\'s Cradle":"Kołyska Walhalli","Myrkheim Mines":"Kopalnie Myrkheimu","Myrkheim Descent":"Zejście w Myrkheim","Mountains of Jotunheim":"Góry Jotunheim","Winter Path":"Zimowa Ścieżka","Northern Reaches":"Północne Rubieże","Lakes of Lyonesse":"Rzeki Lyonesse","Depths of Balor":"Głębiny Balora","Channels of Balor":"Korytarze Balora","Fallen God\'s Rest":"Odpoczynek Upadłego Boga","Olympia Trails":"Szlaki Olympii","Lost Kingdom of Olympia":"Zaginione Królestwo Olympii","Forest Gate":"Leśna Brama","Proving Grounds":"Poligon Doświadczalny","Woven Forest":"Tkany Las","Valley of the Gods":"Aleja Bogów","Onogoro Island":"Wyspa Onogoro","Fen Lagoon":"Półksiężyc Laguna","Fen Halls":"Korytarze Fen","Odin\'s Finger":"Palec Odyna","Dragon\'s Foot":"Smocza Noga","Great Athantia East":"Wielka Athantia Wschód","Old Lyonesse":"Stare Lyonesse","Meropis":"Meropis","Valhalla Bay":"Zatoka Walhalli","Asphodel Meadows":"Łąki Asphodel","Asphodel Trails":"Szlaki Asphodel","A Mushroom of Perilous Visitation":"Grzyb Niebezpiecznego Nawiedzenia","Giant\'s Abyss":"Otchłań Olbrzyma","Northern Battlegrounds":"Północne Pole Bitwy","Underworld Portal":"Portal Do Podziemi","Beast Den":"Legowisko Bestii","Watcher\'s Tomb":"Grobowiec Strażnika","Great Desert Tomb":"Wielki Pustynny Grobowiec","Chaos Portal":"Portal Chaosu","Dragon Roost":"Smocza Nora","Goblin Fortress":"Goblińska Forteca","Shaded Cave":"Zacieniona Jaskinia","Western Battlegrounds":"Zachodnie Pole Bitwy","Bells of Olympia":"Olympijskie Dzwony","Fallen Champion\'s Clearing":"Polana Upadłego Czempiona","Jotunheim Arena":"Arena Jotunheimu","West Suddun Arena":"Zachodnia Arena Suddun","Nothren Sparring Grounds":"Pole do Pojedynku w Nothren","Old Lyonesse Arena":"Stara Arena Lyonesse","Arena of the Gods":"Arena Bogów","Volcanic Arena":"Wulkaniczna Arena","Lythryn Arena":"Arena w Lythryn","Signpost":"Drogowskaz","↑ Jotunheim Mountains":"↑ Góry Jotunheim","Lythryn Woods → No humans allowed!":"Las Lythryn → Zakaz wstępu ludziom!","Fallen Champion\'s Clearing ↑":"Polana Upadłego Czempiona ↑","Great Athantia →":"Wielka Athantia →","← Mountains of Jotunheim":"← Góry Jotunheim","Giant Head":"Wielka Głowa","Head of ?, Great Giant.":"Głowa ???, Wielkiego Olbrzyma.","Head of Gymir, Great Giant.":"Głowa Gymira, Wielkiego Olbrzyma.","Head of Eistla, Great Giant.":"Głowa Eistly, Wielkiego Olbrzyma.","Head of Yagyr, Great Giant.":"Głowa Yagyra, Wielkiego Olbrzyma.","Head of Daga, Great Giant.":"Głowa Dagi, Wielkiego Olbrzyma.","Head of Lamyr, Great Giant.":"Głowa Lamyra, Wielkiego Olbrzyma.","Northern Reaches. Lyonesse ↑":"Rubieże Nothren. Lyonesse ↑","Pillar":"Filar","Old Lyonesse, lain in ruins.":"Stare Lyonesse, zniszczone do gruzu.","Kingdom of Avalon ↓":"Królestwo Avalonu ↓","← Deserts of Suddun":"← Pustynia Suddun","Wrong way!":"Idziesz w złą stronę!","← The Great Bridge":"← Wielki Most","← Myrkheim Mines":"← Kopalnie Myrkheimu","Svarga →":"Svarga →","The Great Plains ↑":"Wielkie Równiny ↑","Vinland ↑ Lythryn Woods →":"Vinland ↑ Las Lythryn →","Fen Halls →":"Korytarze Fen →","Tower of Oceanus":"Wieża Oceanusa","Tower of Selene":"Wieża Seleny","Tower of Themis":"Wieża Themis","Tower of Eos":"Wieża Eos","Tower of Prometheus":"Wieża Prometeusza","Last Message":"Ostatnia Wiadomość","I still remember the day that mother told us we must go. Our towers were crumbling and our sky was falling. I didn\'t want it to end. I didn\'t want to leave home.":"Wciąż pamiętam dzień, w którym nasza matka powiedziała nam, że musimy iść. Nasze wieże się waliły, a niebo poczerniało. Nie chciałem, żeby to się skończyło. Nie chciałem wychodzić z domu.","But they were jealous -- all of them! We didn\'t want power. They did! We only sought knowledge. We only sought peace.":"Ale byli zazdrośni - wszyscy! Nie chcieliśmy władzy. Oni chcieli! My szukaliśmy tylko wiedzy. Chcieliśmy tylko pokoju.","The Jotunheim. The Elysian. The Balor. They came for us. They wanted our magics. They wanted our sky. They tore everything down. They hunted our Titans.":"Jotunheimowie. Elysianie. Balorianie. Przywędrowali po nas. Chcieli naszej magii i potęgi. Chcieli naszego nieba. Zburzyli wszystko na co napotkali. Polowali na naszych Tytanów.","If you are reading this, you have found our home. I hope there is something left. I hope our guardians have protected our Titans. I hope to find my brother again.":"Jeśli to czytasz, widzisz nasz dom. Mam nadzieję, że coś z tego zostało. Mam nadzieję, że nasi strażnicy pomyślnie ochronili naszych Tytanów. Mam nadzieję, że jeszcze odnajdę mojego brata.","We\'re gone now.":"Nas już tutaj nie ma.","Loton Forest Gate":"Brama Lasu Loton","Lythryn Gate":"Brama Lythryn","Athantia Gate":"Brama Athantii","Suddun East Gate":"Wschodnia Brama Suddun","Suddun West Gate":"Zachodnia Brama Suddun","Avalon Gate":"Brama Avalonu","Valhalla\'s Gate":"Brama Valhalli","Myrkheim Gate":"Brama Myrkheimu","Door to Olympia":"Drzwi do Olympii","Balor Gate":"Wrota Balora","Olympia Gate":"Wrota Olympii","Jotunheim Gate":"Wrota Jotunheimu","Gate of the Gods":"Wrota Bogów","The Lyon\'s Gate":"Wrota Lyonu","Island Gate":"Wrota Wyspy","Fen Halls Gate":"Wrota Korytarzy Fen","Champion\'s Gate":"Wrota Czempiona","Ferry to Onogoro":"Prom do Onogoro","Ferry to Meropis":"Prom do Meropis","Asphodel Gate":"Brama Asphodel","Warp here":"Teleportacja","Last visit:":"Ostatnio odwiedzone:","Travel here":"Podróżuj tam","Waygates found in the world may be returned to at will.":"Odnalezione Bramy Teleportacyjne mogą zostać użyte w dowolnej chwili.","Can be used in:":"Może być użyte za:","The Wilds":"Dzicz","A region of Aethric between towns.":"Obszar między miastami w Aethric.","Aethric":"Aethric","Towns":"Miasta","Dungeons":"Lochy","You are not ready to venture forth.":"Nie możesz iść w ten teren.","Leave":"Wyjdź","Are you sure you would like to return to the main menu?":"Czy na pewno chcesz wrócić do głównego menu?","You may not be ready for the challenges in this region.":"Musisz urosnąć w sile aby móc podjąć się wyzwań w tym regionie.","Leave Area":"Opuść Obszar","Main Menu":"Menu Główne","Chat":"Czat","Resume Journey":"Wznów Podróż","Items":"Przedmioty","Tower":"Wieża","Map":"Mapa","New game":"Nowa gra","Load game":"Ładuj grę","Recover character":"Odzyskaj postać","Enter your email address or username below. An email will be sent to the character\'s email address containing a code to recover your character.":"Wprowadź swój adres email lub nazwę użytkownika. Zostanie wysłany email na adres przypisany tej postaci, zawierający kod do odzyskania postaci.","Username or email address":"Nazwa użytkownika lub adres email","Enter a code":"Wprowadź kod","Submit":"Wyślij","Enter the character recovery code that your received via email below.":"Wprowadź kod odzyskania postaci który został wysłany na podany adres email.","Code":"Kod","Please complete all fields":"Wypełnij wszystkie pola","Please enter a valid recovery code":"Wprowadź poprawny kod odzyskiwania","Recovery code activated":"Aktywowano kod","Loading town...":"Ładowanie miasta...","Return to World Map":"Wróć do Mapy Świata","Worker":"Pracownik","Be careful when traveling at night.":"Uważaj na siebie, jeżeli podróżujesz w nocy.","Different foes will show themselves.":"Pojawiają się inni przeciwnicy.","Villager":"Mieszkaniec","Is it raining outside of town?":"Czy zaczęło padać poza miastem?","I heard you may encounter different monsters when the weather is different.":"Możesz spotkać innych przeciwników w różnych warunkach pogodowych.","Helpful Bard":"Pomocny Bard","If you see treasure chests on the ground, make sure you open them before your friends do.":"Jeżeli zobaczysz jakąś skrzynię, otwórz ją szybko, zanim ktoś inny to zrobi.","Noble":"Szlachta","Find a piece of armor you like? The Blacksmith will make it the best it can be. Alchemists and Jewellers can add adornments to it.":"Masz jakąś część zbroi, która Ci się podoba? Kowal sprawi, że będzie jeszcze lepsza niż kiedykolwiek. Alchemicy i Jubilerzy mogą zdobić je ornamentami.","Svargan":"Svarganin","Welcome to Svarga, our town on the Svarga River.":"Witaj w Svardze, naszym mieście przy Rzece Svardze.","The elves of Lythryn lies to the North of here.":"Miasto Elfów z Lythryn leży na północ stąd.","To be honest, they don\'t appreciate outsiders.":"Ale nie wyglądają na takich, którzy ciepło przyjmują obcych.","Athantian":"Athańczyk","Hi! Welcome to Athantia.":"Witaj w Athantii.","Pay a visit to our temple while you\'re here.":"Odwiedź naszą świątynię jak znajdziesz chwilę.","That Pythia...What a weird lady.":"Ta Pythia... To jakaś nietypowa pani.","I wonder why she\'s here.":"Ciekawe po co tu jest.","Please visit our temple every day.":"Odwiedzaj codziennie naszą świątynię.","Hi!":"Witaj!","Angler":"Rybak","Heilsa. Welcome to my humble shop.":"Heilsa. Witaj w moim skromnym sklepie.","Us Svargans only accept coral for our goods. Bring me your best catch and I can reward you plenty.":"My Svargani przyjmujemy tylko koralowce w zamian za nasze towary. Przynieś mi swoje najlepsze zdobycze, a odpowiednio Cię wynagrodzę.","Lythryn Elf":"Lythryński Elf","Welcome to Lythryn.":"Witaj w Lythryn.","...":"...","We don\'t see many humans here.":"Nie widujemy tu często ludzi.","How did you make it through our forest?":"Jakim cudem udało Ci się dotrzeć do naszego lasu?","Citizen":"Mieszkaniec","This is the Kingdom of Avalon.":"To jest Królestwo Avalonu.","It was once a great Kingdom, before the Fallen took most of our people.":"To było kiedyś wielkie Królestwo, do momentu gdy Upadli zabrali większość naszych ludzi.","And our dear King...":"A nasz kochany Król...","Squire":"Giermek","Some day, I will be a great Knight of Avalon.":"Kiedyś będę wielkim Rycerzem Avalonu.","Just like Sir Balin.":"Tak jak Sir Balin.","Aspiring Court Mage":"Aspirujący Dworski Mag","Our Arcanist learns new spells quite often.":"Nasz Arkanista często poznaje nowe zaklęcia.","Visit Merlin\'s Apprentices every day if you are looking to learn something new.":"Odwiedzaj codziennie Uczniów Merlina, jeśli chcesz nauczyć się czegoś nowego.","Court Mage":"Dworski Mag","I was once a Court Mage of Arthus\'s court.":"Byłem kiedyś nadwornym magiem u Arthusa.","He was a great King, honestly.":"Był świetnym Królem.","Jotunn":"Jotunianin","Well met.":"Pozdrowienia.","Welcome to what is left of the Kingdom of Jotunheim":"Witaj w tym co niestety zostało z Królestwa Jotunheimu","We Jotunns are followers of the great giants.":"We Jotunianie jesteśmy poplecznikami wielkich olbrzymów.","They are but a memory now.":"Niestety teraz są tylko wspomnieniem.","Visit our Arcanist while you are here. They may be able to teach you a trick or two.":"Odwiedź naszego Arkanistę, gdy tu jesteś. Może być w stanie nauczyć Cię paru sztuczek.","The Giant\'s Abyss can be found East of here.":"Otchłań Olbrzyma znajduje się na wschód stąd.","\'tis a dangerous dungeon created by our ancestors.":"To niebezpieczny loch stworzony przez naszych przodków.","Merchant":"Handlarz","Suddun is a land of trade.":"Suddun jest narodem handlu.","There isn\'t much for agriculture in the desert, but we\'ve got plenty else to offer to our neighbors in Aethric.":"Na pustyni nie ma wiele dla rolnictwa, ale mamy wiele do zaoferowania naszym sąsiadom w Aethric.","Have coin? You\'ve come to the right place. Visit the Bazaar often to see its unique wares.":"Jeśli masz trochę złota, to jesteś we właściwym miejscu. Często odwiedzaj nasz Bazar, aby zobaczyć jego wyjątkowe towary.","Wandering One":"Wędrowiec","Well, hello.":"Oh, witaj.","Lost Memory":"Zagubione Wspomnienie","Demonsmith":"Demoniczny Kowal","If ye gold the materials, I can Demonforge any Masterforged gear ye might \'ve.":"Jeśli masz materiały, mogę wykuć w demonie każdy mistrzowsko wykuty sprzęt, jaki posiadasz.","But it\'ll cost ye.":"Trochę to kosztuje.","And if ye don\'t have the gold, I\'ve no use for ye.":"Nie ma złota? Nie ma usług.","Ye ain\'t of our kind.":"Nie jesteś od nas.","Nothren Villager":"Mieszkaniec Nothren","It is rumored that we Nothren came here from the far east, atop ships of great height and stature.":"Krążą pogłoski, że my, ludzie z Nothren, przybyliśmy tu z dalekiego wschodu, na pokładach statków ogromnej wielkości i postury.","Contrary to our name, we are not from the North.":"Wbrew pozorom i naszej nazwie, nie pochodzimy z Północy.","Nothren Valkyrie":"Walkiria z Nothren","The Nothren are a long line of those who tame beasts.":"Nothren od początków dziejów są znani z oswajania bestii.","If you are to learn our ways, your bond with your follower will grow quite strong.":"Jeśli kiedyś poznasz nasze metody, Twoja więź z Towarzyszem będzie jeszcze silniejsza.","Nothren Berserker":"Berserker Nothren","\'ve no time for you.":"N\'mam dla Ciebie czasu.","Aye. Welcome to Nothren, traveler.":"Aye. Witaj w Nothren, podróżniku.","Dog":"Pies","(Pet the dog?)":"(Pogłaskać psa?)","(You pet the dog.)":"(Głaszczesz psa.)","(The dog happily wags its tail.)":"(W odpowiedzi radośnie merda ogonem.)","Direwolf":"Wilkor","(Pet the wolf?)":"(Pogłaskać wilka?)","(You pet the wolf.)":"(Głaszczesz wilka.)","(The wolf does not seem happy.)":"(Wilk nie wydaje się być zadowolony z tego.)","(The wolf seems happy.)":"(Wilk wydaje się być szczęśliwy.)","Wolf":"Wilk","(It bit you.)":"(Ugryzł Cię.)","Warning:":"Ostrzeżenie:","Your PvP equipment loadout appears to be missing a weapon or armor.":"W Twoim wyposażeniu Areny brakuje broni lub zbroi.","Your PvP equipment loadout appears to be missing skills or spells.":"Twój zestaw umiejętności PvP nie ma żadnych wypełnionych slotów.","Opponents available:":"Dostępni przeciwnicy:","Hold to Spar":"Przytrzymaj aby się pojedynkować","Contacting game servers...":"Łączenie z serwerami gry...","Waygate Found":"Odnaleziono Bramę Teleportacyjną","You can now freely return to this place from your world map.":"Możesz teraz wrócić do tego miejsca za pomocą mapy świata.","Tap to enter":"Stuknij aby wejść","Tap to read":"Stuknij aby przeczytać","You must move closer.":"Musisz podejść bliżej.","Year:":"Rok:","1004 DCE":"1004 DCE","What is your name, traveler?":"Jak mamy cię nazywać, podróżniku?","Choose your class":"Wybierz swoją klasę","Body A":"Wersja A","Body B":"Wersja B","You may add a recovery email address in case you lose or reset your device. This step is optional.":"Możesz dodać email w celu odzyskania hasła w przypadku jego zagubienia lub zapomnienia. Ten krok nie jest obowiązkowy.","If you have a promo code, you may enter it below. Otherwise, please leave this option blank.":"Jeżeli masz kod promocyjny, wprowadź go tutaj. W przeciwnym wypadku pozostaw to pole puste.","The Land of Aethric":"Kraina Aethric","Upon leaving this forest clearing, you will be placed on the World Map.":"Po opuszczeniu tej leśnej polany pojawisz się na mapie świata.","These lands are quite large, and you may find traversing them a bit slower than what you are used to thus far.":"Krainy te są dość duże i przemierzanie ich może wydawać się nieco wolniejsze.","These lands are also full of dangerous creatures.":"Te krainy są też pełne niebezpiecznych stworzeń.","You must now meet Samson in the nearby town of Loton to begin your journey.":"Spotkaj się z Samsonem w pobliskim mieście Loton, aby rozpocząć swoją podróż.","Goblin":"Goblin","Battle":"Walcz","A Goblin blocks your path. Defeat it to continue your journey.":"Goblin blokuje ci drogę. Pokonaj go, aby kontynuować podróż.","Tutorial":"Samouczek","You awake in a forest clearing. Your memory is a little blurry.":"Budzisz się na leśnej polanie. Twoja pamięć jest trochę rozmyta.","Drag your finger across the ground to look around.":"Przeciągnij palcem po ekranie aby się rozglądać.","Ahead of you lie a number of Epitaphs. Interact with them to recall your memory.":"Przed tobą znajduje się kilka epitafiów. Wejdź z nimi w interakcję, aby odzyskać swoją pamięć.","A Goblin blocks your path ahead. Defeat it to begin your journey.":"Goblin blokuje Ci drogę. Pokonaj go, aby rozpocząć Twoją podróż.","Warrior":"Wojownik","A melee class who favors physical attacks and brute strength over magic. It can wield heavier weapons and armor.":"Klasa walcząca w zwarciu, która preferuje ataki fizyczne i brutalną siłę nad magią. Może dzierżyć cięższą broń i zbroję.","Mage":"Mag","A skilled individual who favors magic over strength. It can wield staves and robes.":"Doświadczona istota, która przedkłada magię nad siłę. Potrafi dzierżyć laski i szaty.","Thief":"Łotrzyk","A tricky fighting class that favors speed and damage over defense. It can wield light armor, daggers, bows.":"Zwinna klasa bojowa, która przedkłada szybkość i obrażenia zamiast obrony. Może nosić lekką zbroję, sztylety, łuki.","Epitaph":"Epitafium","Svarga Port / Dragon\'s Wing":"Port Svarga / Smocze Skrzydło","Avalon Adventurer\'s Guild":"Gildia Poszukiwaczy Przygód Avalonu","Hellfire Adventurer\'s Guild":"Gildia Poszukiwaczy Przygód Piekielnego Ognia","Demeter\'s Adventurers":"Poszukiwacze Przygód Demeter","Northern Adventurer\'s Guild":"Północna Gildia Poszukiwaczy Przygód","Lythryn Adventurer\'s Guild":"Gildia Poszukiwaczy Przygód Lythryn","Underground Adventurer\'s Guild":"Podziemna Gildia Poszukiwaczy Przygód","Suddun Adventurer\'s Guild":"Gildia Poszukiwaczy Przygód Suddun","Svarga Adventurer\'s Guild":"Gildia Poszukiwaczy Przygód Svarga","Use the directional joystick to move your character.":"Użyj pada kierunkowego, aby poruszać swoją postacią.","Additionally, you can hold your finger down on a location for 1 second to set a manual destination.":"Możesz przytrzymać palec na lokalizacji przez 1 sekundę, aby ustawić miejsce docelowe ręcznie.","Forgotten Forest":"Zapomniany Las","A forest forgotten to the world.":"Las, o którym świat dawno zapomniał.","Circle of Anguish":"Krąg Cierpienia","Giant\'s Adventurer Guild":"Gildia Podróżników Olbrzyma","Forgotten Isle":"Zapomniana Wyspa","Forgotten Isle Gate":"Brama Zapomnianej Wyspy","Training Arena":"Arena Treningowa","Practice combat, collect souls, earn gold, and find unique items by sparring with AI controlled characters in this practice arena.":"Ćwicz walkę, zbieraj dusze, zdobywaj złoto i znajduj unikalne przedmioty, pojedynkując się z postaciami kontrolowanymi przez SI na tej arenie ćwiczeniowej.","In this arena, you will be matched against AI controlled players that are at similar level in the game as yourself. If you find them to be challenging, you may need to upgrade your equipment.":"Na tej arenie zmierzysz się z graczami kontrolowanymi przez SI, którzy są na podobnym poziomie gry jak Ty. Jeśli uznasz ich za zbyt silnych, być może konieczne będzie ulepszenie Twojego sprzętu.","Blade\'s Landing":"Port Ostrzy","Training grounds of the great Blades of Finesse PvP Guild.":"Tereny treningowe wielkiej gildii PvP Ostrzy Finesse.","Blades of Finesse Guild Hall":"Hala Gildyjna Ostrzy Finesse","Olympian Ruins":"Olympiańskie Ruiny","Onogoro Woods":"Las Onogoro","Hobgoblin Fortress":"Forteca Hobgoblinów","The Depths":"Głębia","Monumental Guild":"Monumentalna Gildia","Guild Hall of the Monumental Guild.":"Hala Gildyjna Monumentalnej Gildii.","Monumental Guild Hall":"Hala Monumentalnej Gildii","Monument of Demeter":"Monument Demeter","Monument of Thor":"Monument Thora","Monument of Ithra":"Monument Ithry","Monument of Vulcan":"Monument Vulcana","Meropis Gate":"Brama Meropis","Leave review":"Oceń nas","Map Options":"Opcje Mapy","Show player":"Pokaż gracza","Show monsters":"Pokazuj potwory","Show bosses":"Pokazuj bossy","Show NPCs":"Pokazuj NPC","Show Raids":"Pokaż Rajdy","Show items":"Pokazuj przedmioty","Show compass":"Pokaż kompas","If a character matches the username or email given, an email will be sent to the recovery email address registered to that character.":"Jeżeli postać jest zgodna z podanym adresem e-mail, zostanie na niego wysłana wiadomość.","If you do not receive an email, then it is likely that no recovery email was attached to the character. Please reach out to support at help@playorna.com for help attaching an email address to a lost character.":"Jeśli nie otrzymasz wiadomości, prawdopodobnie do postaci nie został przypisany żaden adres e-mail. Skontaktuj się z pomocą techniczną pod adresem help@playorna.com, aby uzyskać pomoc w dołączeniu adresu e-mail do postaci.","You are unable to interact with this object at this time.":"Nie możesz wejść w interakcję z tym obiektem.","All stats":"Wszystkie statystyki","No giver":"Brak źródła","Defeat {monster}":"Pokonaj przeciwnika: {monster}"}')}}]);